export default (function(a,b,c,d,e,f,g,h,i,j,k){return {data:{"9EdY7FwJjp":{data:[{id:2745,attributes:{type:e,item_lang:{data:{id:3412,attributes:{title:"House of the Dragon",slug:"house-of-the-dragon"}}}}},{id:2747,attributes:{type:b,item_lang:{data:{id:3414,attributes:{title:"Bullet Train",slug:"bullet-train"}}}}},{id:2752,attributes:{type:b,item_lang:{data:{id:3419,attributes:{title:"White Noise",slug:"white-noise"}}}}},{id:2765,attributes:{type:b,item_lang:{data:{id:3432,attributes:{title:"Argylle",slug:"argylle"}}}}},{id:2772,attributes:{type:e,item_lang:{data:{id:3439,attributes:{title:"Super Pumped",slug:"super-pumped"}}}}}],meta:{pagination:{page:f,pageSize:25,pageCount:f,total:5}}},ixr76ro7Rp:{data:{id:767,attributes:{imdbId:"tt6565702",poster:"https:\u002F\u002Fm.media-amazon.com\u002Fimages\u002FM\u002FMV5BMmZmYTgwZGItNDIxMS00MmRkLWEzODQtYTllNzM0ZWE1NmQ5XkEyXkFqcGdeQXVyODQzNTE3ODc@._V1_SX300.jpg",type:b,ratings:[{Source:"Internet Movie Database",Value:"5.7\u002F10"},{Source:"Rotten Tomatoes",Value:"22%"},{Source:"Metacritic",Value:"43\u002F100"}],item_lang:{data:{id:1430,attributes:{title:"X-Men: Dark Phoenix",plot:"The X-Men. Protectors of peace. Jean Grey is one of the most beloved X-Men. But when a mission goes wrong, Jean is exposed to a dark and ancient power. This power has destroyed everything it comes in contact with, until her. Now that this power is becoming unstable, she releases it with destruction and anger. Now that this foreign power is consuming her, and the world is threatened, the X-Men have to face an important truth: they must save either the world, or their friend who threatens it.",slug:"x-men-dark-phoenix"}}},books:{data:[{id:4903,attributes:{title:g,description:"Writer\u002Fartist John Byrne's retro take on the X-Men, set between their Silver Age title and the All-New, All-Different incarnation, comes to a calamitous conclusion. The original X-Men take on the Brotherhood of Evil Mutants, mutant-controlled Sentinels, Angel's evil uncle Burt, the long-lost Yeti, Kraven the Hunter and the mysterious mutant group the Promise and a 'crossover' with a classic Lee\u002FKirby\u002FRomita Fantastic Four tale. Collecting: X-Men: The Hidden Years 13-22, Fantastic Four (1961) 102-104; material from Yellow Claw 2 and Amazing Adult Fantasy 14.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=JpZiAAAACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:[a],firstBook:true,published:"2006-04-05",publisher:h,subtitle:"The Dark Phoenix Saga"}},{id:4904,attributes:{title:g,description:"Gathered together by Professor Charles Xavier to protect a world that fears and hates them, the X-Men had fought many battles, been on adventures that spanned galaxies, grappled enemies of limitless might, but none of this could prepare them for the most shocking struggle they would ever face. One of their own members, Jean Grey, has gained power beyond all comprehension, and that power has corrupted her absolutely! Now they must decide if the life of the woman they cherish is worth the existence of the entire universe! Collects Uncanny X-Men (1963) #129-137.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=FW8tPykf5cMC&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:[a],firstBook:c,published:"2010-08-11",publisher:i,subtitle:j}},{id:4905,attributes:{title:"X-Men: Dark Phoenix Saga Omnibus",description:"The greatest comic book saga ever told, in one cosmic-sized Omnibus! It begins with a shocking story in which Marvel Girl sacrifices herself...only to be reborn as Phoenix! But when a galaxy-spanning adventure reveals that Jean Grey has somehow attained power beyond conception, Cyclops and the X-Men can only watch as Phoenix is corrupted absolutely. As the team faces the Shi'ar Empire, Hellfi re Club and more, can Jean Grey be redeemed? Chris Claremont, Dave Cockrum and John Byrne weave an epic tale of triumph and tragedy that changed everything for the X-Men - and all of comics! It's the full Dark Phoenix Saga, with bonus tales illuminating Jean Grey's defining story! COLLECTING: X-MEN 97-105, 107-108, 125-138; PHOENIX: THE UNTOLD STORY 1; MATERIAL FROM CLASSIC X-MEN 6, 8, 13, 18, 24, 43; BIZARRE ADVENTURES 27, WHAT IF? (1977) 27",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=EPVRtAEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:[a],firstBook:c,published:"2018-08-14",publisher:h,subtitle:d}},{id:4906,attributes:{title:"The Uncanny X-Men",description:d,thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=8Qf6LwEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:[a,k],firstBook:c,published:"2012-01-01",publisher:d,subtitle:"Dark Phoenix"}},{id:4907,attributes:{title:"X-Men Milestones",description:"Collects Uncanny X-Men (1963) #129-137. The biggest and best adventures of Marvels mighty mutants  these are the X-Men Milestones! It doesnt get any more iconic than this tale of triumph and tragedy! The X-Men have fought many battles, embarked on galaxy-spanning adventures and defeated enemies of limitless might  but none of it prepared them for the most shocking struggle they would ever face. One of their own, Jean Grey, has gained cosmic power beyond all comprehension  and that power has corrupted her absolutely! Now the X-Men must decide between the life of the friend they cherish and the possible destruction of the entire universe! This touching tale of ultimate power and the triumph of the human spirit has been a cornerstone of the X-Men mythos for decades. Relive the saga that changed everything!",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=QYOPDwAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:[a,k],firstBook:c,published:"2019-06-26",publisher:i,subtitle:j}}]}}},meta:{}}},prerenderedAt:1681309468200}}("Chris Claremont","movie",null,"","series",1,"X-Men","Marvel","Marvel Entertainment","Dark Phoenix Saga","John Byrne"))